function feedforward(input) {
    for (let i = 0; i < biases.length; i++) {
        const weightedInput = dotProduct(weights[i], input).map((val, idx) => val + biases[i][idx]);
        input = weightedInput.map(sigmoid);
    }
    return input;
}


function dotProduct(matrix, vector) {
    return matrix.map(row => row.reduce((sum, val, idx) => sum + val * vector[idx], 0));
}

function sigmoid(z) {
    return 1 / (1 + Math.exp(-z));
}

